import logoMEW from './logoImage';
import logo from './mobile-icon';
import spaceman from './spaceman';
import refresh from './refreshIcon';
import playStoreButton from './button-google-play-color';
import appStoreButton from './button-app-store';
import camera from './camera';
import closeIconWhite from './closeIconWhite'
import closeIconBlack from './closeIconBlack'

export {
  logoMEW,
  logo,
  refresh,
  spaceman,
  playStoreButton,
  appStoreButton,
  camera,
  closeIconWhite,
  closeIconBlack
};
